export const translate = (str, lang) => {
  const dictionary = {
    'Espa単ol': {
      'Ingles': 'Spanish',
    },
    'Ingles': {
      'Ingles': 'English',
    },
    'Idioma': {
      'Ingles': 'Language',
    },
    'Nuevo Cliente': {
      'Ingles': 'New Customer',
    }

  }
  if (lang == 'Espa単ol') {
    return str;
  }
  else {
    return dictionary[str] ? dictionary[str][lang] : str
  }
};
